INSERT INTO `blogs` VALUES (11,'Article on Journey in Joy','This blog is an abridged version of an independent article written by Dr V Anantha Nageswaran and S Raghuraman titled “How to Push MSME Entrepreneurs into Making it Big in Business” published in Swarajya Online Magazine.','11_1582556687.jpg','<div class=\"ql-editor\" data-gramm=\"false\" contenteditable=\"true\" data-placeholder=\"Compose an epic...\"><p><span style=\"color: rgb(153, 153, 153);\">This blog is an abridged version of an independent article written by&nbsp;Dr V Anantha Nageswaran and S Raghuraman titled</span><em style=\"color: rgb(153, 153, 153);\"> “How to Push MSME Entrepreneurs into Making it Big in Business”</em><span style=\"color: rgb(153, 153, 153);\"> published in Swarajya Online Magazine. Dr V Anantha Nageswaran is also an advisor of Poornatha.</span></p><p><span style=\"color: rgb(153, 153, 153);\">The full version of the article can be read at:</span><a href=\"https://swarajyamag.com/business/how-to-push-msme-entrepreneurs-into-making-it-big-in-business\" target=\"_blank\">&nbsp;https://swarajyamag.com/business/how-to-push-msme-entrepreneurs-into-making-it-big-in-business</a> </p><h2>How To Push MSME Entrepreneurs Into Making It Big In Business?</h2><p>Even a little nudge in the direction of good management — bringing in simple practices related to target setting, establishing incentives and monitoring performance — can bring about substantial improvements in productivity, sales growth and even reduction in product defects of these enterprises.</p><p>Training entrepreneurs obviously appears to be the most time-tested and feasible intervention to bring about change. But, what makes such an intervention effective for entrepreneurs and their enterprises is not what is on offer in the marketplace.</p><p>Any book on entrepreneurship would repeatedly underscore the importance of managing finance. Multiple chapters are dedicated to expounding the virtues of this function. Cliches that signify it abound; lifeblood, the soul of an organisation, engine of growth and so on and so forth.</p><p>When we spoke to these entrepreneurs what became clear is this impulsiveness stems from a lack of awareness about the importance and usage of data-driven decision-making frameworks.</p><p>So, a training intervention cannot be a workshop that offers just tools and techniques.</p><p>But, this is predicated on the assumption that the owners/promoters of MSMEs have a fair grasp about key dimensions of leadership and leadership styles.</p><p><br></p><h2>What is Journey in Joy (JnJ)?</h2><p>Poornatha, an initiative started by Bharath Krishna Shankar, an entrepreneur from Madurai, launched a pilot project called Journey in Joy (JnJ) a couple of years back to train MSME entrepreneurs in a few southern districts of Tamil Nadu.</p><p>JnJ diverged from the general trend and focused on the most critical or must-know concepts for managing enterprises.</p><p><em>For instance</em>, its finance module distilled and simplified key concepts that an entrepreneur should know and ensured that they understood the essence of such concepts.</p><p>In JnJ, a strong emphasis was also placed on the application of concepts to the businesses that the participants run. It took several shapes.</p><p><em>For instance</em>, feedback mails from the participants after every session ensured that they not only understood the concepts but also demonstrated evidence of having applied some of it to either their personal lives (for example, time management) and/or organisational lives (for example, how they used an employee matrix). Exercises and activities conducted in the classes also strongly linked back to their businesses.</p><p><em>For instance</em>, participants were encouraged to fill in their enterprise numbers in pre-designed Excel sheets to see the financial impacts of decisions or role-plays hovered around actual situations they face in their organisations.</p><p>The third important aspect of customised design and delivery was focused on participants’ learning from their peers through listening to others’ presentations or joint exercises or even, as in some cases, visiting others’ organisations to gain an understanding of how some practices work.</p><p>Recent studies show that peer learning can have a significant and positive impact on the entrepreneur and enterprise.</p><p><strong><em>A key pivot around which JnJ turned was the fact that the trainer was an entrepreneur; someone who has walked the talk.</em></strong></p><p>In the literature on entrepreneurship, there is a debate on whether entrepreneurship can be taught and if so by whom.</p><p>Essentially, the divide could be caricatured as between practice and theory. At one end, some have argued, quite vehemently, that the training of entrepreneurs is better left to other entrepreneurs.</p><p>Evidence shows that a mix of faculty and practitioners — the blend of theory and practice — provides a better balance and favourable outcomes. Other effective practices include structured programmes for training the trainer.</p><p><strong><em>A major feature of JnJ was the creation of a robust business plan by the participants. This was the capstone component of the training programme. It was impactful for two reasons.</em></strong></p><p>One, the formulation of a business plan drew the entrepreneur’s understanding of different management elements that have been introduced in the course.</p><p><em>For example</em>, entrepreneurs were able to see how a reduction in their ‘cost of goods sold’ can affect their profit or how an estimated increase in revenue (and proportionately expenditure) leaves them with a larger pie that can then be distributed as incentives for employees or how to focus on key segments can improve profitability.</p><p>The initiative of Poornatha in designing and delivering JnJ, the entrepreneurship development programme has both practical and policy insights and relevance.</p><p>At the practical level, it has shown to entrepreneurs that they have it in them to do a lot better and that they could imagine a bolder future than incremental improvements.</p><p>The programme has also shown them that methods that help productivity in businesses can also work at home, creating a conducive atmosphere for entrepreneurs to be able to perform at or above their potential in both settings.</p><p>At the policy level, there are at least two important lessons. One is that much of the discourse on entrepreneurship focuses on traditional interventions such as infrastructure, tax incentives and financing.</p><p>Skills, attitudes and knowhow are neglected. They stand in the way of growth and scaling up. That has macroeconomic consequences.</p><p>Second, the JnJ programme has shown that, given the massive numbers of entrepreneurs in the country, a simple, relevant and effective training intervention can be designed and that it can have huge multiplier effects both at the firm level and for the economy.</p></div><div class=\"ql-clipboard\" contenteditable=\"true\" tabindex=\"-1\"></div><div class=\"ql-tooltip ql-hidden\"><a class=\"ql-preview\" target=\"_blank\" href=\"about:blank\"></a><input type=\"text\" data-formula=\"e=mc^2\" data-link=\"https://quilljs.com\" data-video=\"Embed URL\"><a class=\"ql-action\"></a><a class=\"ql-remove\"></a></div>','Active','Yes','big-in-business','Poornatha','Article on Journey in Joy','blog','https://swarajyamag.com/business/how-to-push-msme-entrepreneurs-into-making-it-big-in-business','V. Anantha Nageswaran and S. Raghuraman','2020-02-21 00:59:26','2020-02-24 15:09:14'),(12,'Mass Entrepreneurship in Tamil Nadu-Survey Report','Mass enterprises, which refers to millions of ordinary local businesses, are providers of stable job opportunities and the sector, if nurtured, can help address the country’s unemployment issues, according to survey report titled ‘Mass Entrepreneurship in Tamil Nadu’.','12_1582552697.png','<div class=\"ql-editor\" data-gramm=\"false\" contenteditable=\"true\" data-placeholder=\"Compose an epic...\"><p>Mass enterprises, which refers to millions of ordinary local businesses, are providers of stable job opportunities and the sector, if nurtured, can help address the country’s unemployment issues, according to survey report titled ‘Mass Entrepreneurship in Tamil Nadu’.</p><p>This study is a first of its kind and size by a private entity in an attempt to get an in-depth understanding of the working, financial knowledge, challenges and mindsets of Mass entrepreneurs. The survey was done through college students across Tamil Nadu.</p><p>Poornatha along with&nbsp;<a href=\"https://www.linkedin.com/company/tiechennai/\" target=\"_blank\">TiE Chennai</a>&nbsp;and&nbsp;<a href=\"https://www.linkedin.com/company/game-india/\" target=\"_blank\">G.A.M.E. India</a>&nbsp;released the Survey Report in India on Mass Entrepreneurship in the presence of Mr CK Ranganathan, President- TiE Chennai and Founder Chairman of CavinKare, Ms&nbsp;<a href=\"https://www.linkedin.com/in/akhila-rajeshwar-46aa2017\" target=\"_blank\">Akhila Rajeshwar</a>, Executive Director- TiE Chennai and Mr&nbsp;<a href=\"https://www.linkedin.com/in/madanpadaki\" target=\"_blank\">Madan Padaki</a>&nbsp;Co-founder of G.A.M.E.</p><p><u>Key take-aways from the report:</u></p><ol><li>Mass enterprises are stable job providers: the average age of businesses surveyed was 13 years with about 50% of them at least 10 years old</li><li>Among mass enterprises, manufacturing firms are a key opportunity, typically employing more people than the service industry, generating more revenue per employee, and having less informality (e.g. more supply chain credit, higher percentage of second line managers)</li><li>Minimal digitisation of accounting and poor cash flow management are common and possible barriers to accessing finance</li><li>Accounting, managing finances &amp; statutory requirements are the areas that majority mass entrepreneurs need support</li></ol><p>To read the full report click:</p></div><div class=\"ql-clipboard\" contenteditable=\"true\" tabindex=\"-1\"></div><div class=\"ql-tooltip ql-hidden\" style=\"left: 91.7083px; top: 190px;\"><a class=\"ql-preview\" target=\"_blank\" href=\"https://www.linkedin.com/in/madanpadaki\">https://www.linkedin.com/in/madanpadaki</a><input type=\"text\" data-formula=\"e=mc^2\" data-link=\"https://quilljs.com\" data-video=\"Embed URL\"><a class=\"ql-action\"></a><a class=\"ql-remove\"></a></div>','Active','Yes','mass-entrepreneurship-survey-report','mass entrepreneurship survey report research poornatha','Poornatha along with TiE Chennai and G.A.M.E. India released the Survey Report in India on Mass Entrepreneurship','kc','https://drive.google.com/open?id=1wbFSPY2OvTfJK2DhDHP4NE3ztyaXLady','Poornatha','2020-02-24 12:45:59','2020-02-24 14:00:42'),(13,'A Study of Determinants of Entrepreneurship and its Impact on MSME Sector Sustainability in Madurai District','Our Founder and Chief Mentor - Dr Bharath Krishna Sankar’s doctoral thesis on “Determinants of entrepreneurship and its impact on MSME sector sustainability in Madurai district”, embodies his passion for uplifting the MSME sector.','13_1582552608.jpeg','<div class=\"ql-editor\" data-gramm=\"false\" contenteditable=\"true\" data-placeholder=\"Compose an epic...\"><p>Our Chief Mentor - Dr Bharath Krishna Sankar’s doctoral thesis on “Determinants of entrepreneurship and its impact on MSME sector sustainability in Madurai district”, embodies his passion for uplifting the MSME sector.</p><p>Major learning from the thesis is that the ‘know-what and know-how’ on owning numbers and handling people is a major need of the MSME entrepreneurs. Poornatha aims to fill this gap through <a href=\"https://poornatha.com/jnj\" target=\"_blank\">Journey in Joy</a> (JnJ).</p><p class=\"ql-align-justify\">To access the full thesis click:</p><p><a href=\"https://poornatha.com/jnj\" target=\"_blank\">https://poornatha.com/jnj</a></p></div><div class=\"ql-clipboard\" contenteditable=\"true\" tabindex=\"-1\"></div><div class=\"ql-tooltip ql-hidden\"><a class=\"ql-preview\" target=\"_blank\" href=\"about:blank\"></a><input type=\"text\" data-formula=\"e=mc^2\" data-link=\"https://quilljs.com\" data-video=\"Embed URL\"><a class=\"ql-action\"></a><a class=\"ql-remove\"></a></div>','Active','Yes','phd-thesis-msme-madurai-tamilnadu-dr-bharathks','A Study of Determinants of Entrepreneurship and its Impact on MSME Sector Sustainability in Madurai District phd thesis msme madurai tamilnadu dr.bharathks','A Study of Determinants of Entrepreneurship and its Impact on MSME Sector Sustainability in Madurai District','kc','https://drive.google.com/open?id=1gKE3z6nKfbmApnfgxDbdYBURfwo9Izkk','Poornatha','2020-02-24 13:56:48','2020-09-16 09:12:39'),(14,'Impact and Effectiveness of MSME Entrepreneurs Training Program – A Case Study of Journey in Joy','Studies show that bringing in simple practices related to target setting, establishing incentives and monitoring performance can bring about substantial improvements in productivity, sales growth and reduction in product defects of MSMEs.','14_1584591835.png','<div class=\"ql-editor\" data-gramm=\"false\" contenteditable=\"true\" data-placeholder=\"Compose an epic...\"><p><strong>Abstract of the Case Study</strong></p><p><strong>﻿</strong>Studies show that bringing in simple practices related to target setting, establishing incentives and monitoring performance can bring about substantial improvements in productivity, sales growth and reduction in product defects of MSMEs. Training entrepreneurs obviously appears to be the most time-tested and feasible intervention to bring about such a change. But are these training initiatives possible? What impact would it have on the entrepreneurs? What challenges would private entities face in conducting such training programs? To answer these questions, a training initiative in Tamil Nadu by Poornatha was examined. The program titled ‘Journey in Joy’ (JnJ) offered business skills training for 27 entrepreneurs in the Southern districts of Tamil Nadu. For this study, data was collected from a survey of all the participants, in-depth interviews conducted with the founder, trainers and 10 participants of the program. Also, data was collected from secondary sources including program content booklets, worksheets and exercises, written and video feedback of participants and business plans that the entrepreneurs had developed as a part of the program. Results from this study point out to a significant shift across entrepreneur mindsets, capabilities and enterprise performance. In short, the program has successfully demonstrated that a customized, impactful and low-cost training program for entrepreneurs is feasible.</p><p><br></p><p>Access the full case study by clicking the link below:</p></div><div class=\"ql-clipboard\" contenteditable=\"true\" tabindex=\"-1\"></div><div class=\"ql-tooltip ql-hidden\"><a class=\"ql-preview\" target=\"_blank\" href=\"about:blank\"></a><input type=\"text\" data-formula=\"e=mc^2\" data-link=\"https://quilljs.com\" data-video=\"Embed URL\"><a class=\"ql-action\"></a><a class=\"ql-remove\"></a></div>','Active','Yes','Impact-and-Effectiveness-of-MSME-Entrepreneurs-Training-Program-A-Case-Study-of-Journey-in-Joy','Entrepreneurship, training effectiveness, MSMEs, entrepreneur mindset','A Case Study of Journey in Joy -Impact and Effectiveness of MSME Entrepreneurs Training Program','kc','https://drive.google.com/open?id=1rTDt3KacHYTARc58-m-mIrtvQTcrfy4z','Dr S Raghu Raman and Dr V Anantha Nageswaran','2020-03-18 05:51:48','2020-03-19 11:33:08'),(17,'Can MSMEs Work from Home? (#WFH)','#WFH has been the buzz word across the globe for close to a month now. This blog is an attempt at helping you understand – ‘if and how’ work from home is possible to you or your business.','17_1585655271.jpg','<div class=\"ql-editor\" data-gramm=\"false\" contenteditable=\"true\" data-placeholder=\"Compose an epic...\" spellcheck=\"false\"><p><strong><em>#WFH </em></strong>has been the buzz word across the globe for close to a month now. From the wake of Covid-19 outbreak, IT and IT enabled organisations have been quick to adopt Work from Home (WFH) with ease.&nbsp;While the Govt and International Organisations also promoted it extensively, critics have also pointed out that work from home is a luxury that is not open to all. According to AIMO- (All India Manufacturers Association) work from home is applicable to less than 8% of the core MSME (Ministry of Micro, Small and Medium Enterprises) and services sector.[1]</p><p>This blog is an attempt at helping you understand – ‘if and how’ work from home is possible to you or your business.</p><p><strong style=\"color: rgb(153, 153, 153);\"><em><u>Before you read further</u>:&nbsp;</em></strong><em style=\"color: rgb(153, 153, 153);\">For most MSMEs, survival is the only important thing during this testing time. Survival depends on cash flow. We strongly recommend that you plan your cash flow for the next two months at least, keeping in mind salaries and wages (Read:&nbsp;</em><a href=\"https://www.businesstoday.in/current/economy-politics/relief-for-employers-govt-to-bear-epfo-contribution/story/399304.html\" target=\"_blank\" style=\"color: rgb(153, 153, 153);\"><em><u>Govt.’s EPF contribution</u></em></a><em style=\"color: rgb(153, 153, 153);\"><u>[2]</u>), loan repayment (Read:&nbsp;</em><a href=\"https://www.livemint.com/money/personal-finance/six-things-to-know-about-rbi-s-moratorium-on-emi-11585397831963.html\" target=\"_blank\" style=\"color: rgb(153, 153, 153);\"><em><u>Moratorium on EMI[3]</u></em></a><em style=\"color: rgb(153, 153, 153);\">), supplier payments, rent, insurance, etc.</em>  </p><p>At the outset we would like to acknowledge that for the majority of MSMEs most of the critical and operational functions cannot be done remotely. However, we would like to narrate a few instances where the necessity has forced MSME organisations to innovate and evolve.</p><p>For instance, one rice manufacturer from Theni has implemented work from home for his second line leaders and office staff (Production Head, Accounts Head, HR, Executives and Data entry operators) though the operational staff have been given leave (with pay). They have made the best of the situation and are using this time to migrate data from their legacy ERP to a newly developed cloud-based ERP and are also testing the same. The HR has been active in handling the crisis situation and also coordinating with a HR consultant to develop and implement best HR practices including creation of Role Clarity Document, identify KRAs (Key Result Areas) and KPIs (Key Performance Indicators) and developing a performance appraisal system (Performance Score Card). They are also looking at developing Process documentation and SOPs (Standard Operating Procedure) in the coming weeks.</p><p>The director of the company, who is an alumnus of <a href=\"http://www.jnjacademy.com/\" target=\"_blank\">Journey in Joy</a> (Leadership Transformation Program), says though there are difficult times ahead of us the work their team is putting in during this one or two months will help them come out of it stronger than ever.</p><p>Interestingly, in this example, most of the employees had their own personal laptops to work on and desktops were set up in the houses of those who didn’t.</p><p>Another interesting example is from an Architect’s firm in Madurai which has started a research to understand their customers preferences through an online survey using google forms in addition to regular drawing work.</p><p>These are normal MSME players who up until they were pushed against the wall had their reservations on the possibility of doing any work from home.</p><p>We ourselves at Poornatha have been working full-fledged from home. In addition to our regular work, we are working with third parties who are also working from home on:&nbsp;</p><ol><li>developing a Business Assessment tool for MSMEs with our partners from <a href=\"https://madeentrepreneur.org/\" target=\"_blank\">MADE</a>,</li><li>developing multiple online portals for knowledge sharing with two different tech companies.</li><li>designing course material and books through designers</li><li>streamlining processes and creating SOPs, preparing checklists for our various activities</li></ol><p>We do understand that for most MSMEs, some IT infrastructure upgradation and reorganising is required to be able to work remotely– and that’s easier said than done. Business owners also worry about communication problems, employee isolation, data security issues and diminished productivity.</p><p>To make the best of the situation the following are some areas we think MSME Leaders and their teams may try working from home:</p><ol><li>Write a Business Plan that you have always wanted to but never had the time</li><li>Come up with a Marketing plan or a Sales Plan</li><li>Do a Market Study on the internet</li><li>Learn about the various government scheme and benefits applicable to your business or industry</li><li>Understand the laws and regulations that your business has to comply with</li><li>Learn best practices in your industry from across the globe</li><li>Learn online marketing or simply create an online presence for your business</li><li>Write SOPs (Standard Operating Procedure) for your core functions</li><li>Write down HR processes and Policies</li><li>Develop or update your website (most web-developers and content writers are Working From Home, this is the best time to get this done)</li><li>Explore productivity apps to better manage your team and your work (Example: todoist, Microsoft Planner, <a href=\"https://quire.io/\" target=\"_blank\">quire.io</a>, Trello, Asana)</li><li>Read and discuss industry related-articles with your team</li></ol><p>Though this list may seem long, after you talk with your employees it will seem too short :)</p><p>Get on a call with your team, give examples of work that you think can be done remotely, give them one- or two-days’ time to come up with a list, they might actually surprise you. Because necessity is the mother of all invention.</p><p>There are more than enough articles on the internet outlining the Do and Don’t of Work from Home for both the employer and employees which generally seem to include</p><ul><li>Maintaining a regular schedule</li><li>Having a private workspace setup (as much as possible), with a good chair desk and lighting if possible</li><li>Frequent calls with the team including video calls to bring the human connection and seamless communication</li><li>Setting expectations and clarification with family members</li></ul><p>Working from home or not, being in regular touch with your team through texts, calls and video conferencing is very important to keep the team together.</p><p>Once the situation normalises it will again be a sprint for survival for most MSMEs. However, it might be important for MSMEs to identify and try-out tasks that could be done remotely. It could open up new avenues and change the way you look at staffing. Location might not be a constraint for some roles. Some of these tasks could possibly be done by a part-time employee who might be sitting in another city. Remote companies gain competitive advantages, like the ability to hire from larger talent pools and reduce their utility and equipment costs.</p><p>At the cost of sounding clichéd, when life gives you lemons make lemonade. Let’s make the best of the situation and come out of this lockdown stronger and wiser.</p><p class=\"ql-align-center\">#Blog written from home! ?</p><p class=\"ql-align-center\">#StayHome #StaySafe</p><p><a href=\"#_ftnref1\" target=\"_blank\">[1]</a> <a href=\"https://www.fortuneindia.com/venture/covid-19-aimo-seeks-relief-for-msmes/104321\" target=\"_blank\">https://www.fortuneindia.com/venture/covid-19-aimo-seeks-relief-for-msmes/104321</a></p><p><a href=\"#_ftnref2\" target=\"_blank\">[2]</a> <a href=\"https://www.businesstoday.in/current/economy-politics/relief-for-employers-govt-to-bear-epfo-contribution/story/399304.html\" target=\"_blank\">https://www.businesstoday.in/current/economy-politics/relief-for-employers-govt-to-bear-epfo-contribution/story/399304.html</a></p><p><a href=\"#_ftnref3\" target=\"_blank\">[3]</a> <a href=\"https://www.livemint.com/money/personal-finance/six-things-to-know-about-rbi-s-moratorium-on-emi-11585397831963.html\" target=\"_blank\">https://www.livemint.com/money/personal-finance/six-things-to-know-about-rbi-s-moratorium-on-emi-11585397831963.html</a></p><p><a href=\"https://quire.io/\" target=\"_blank\">https://quire.io/</a></p></div><div class=\"ql-clipboard\" contenteditable=\"true\" tabindex=\"-1\"></div><div class=\"ql-tooltip ql-hidden\"><a class=\"ql-preview\" target=\"_blank\" href=\"about:blank\"></a><input type=\"text\" data-formula=\"e=mc^2\" data-link=\"https://quilljs.com\" data-video=\"Embed URL\"><a class=\"ql-action\"></a><a class=\"ql-remove\"></a></div>','Active','Yes','msme-work-from-home','Can MSMEs Work from Home? (WFH) #wfh working india tamilnadu economy small business','Can MSMEs Work from Home? (#WFH)','blog',NULL,'Poornatha','2020-03-31 10:38:44','2020-04-15 07:35:00'),(18,'சிறு நிறுவனங்கள் வீட்டிலிருந்து வேலை செய்ய முடியுமா? (#WFH)','எப்படி செய்வது?, உங்களுக்கும் உங்கள் நிறுவனத்திற்கும் எப்படி சாத்தியமாகும்?','18_1586330432.jpg','<div class=\"ql-editor\" data-gramm=\"false\" contenteditable=\"true\" data-placeholder=\"Compose an epic...\"><p>உலகம் முழுவதும் ஒரு மாதத்திற்கும் மேலாகப்&nbsp;பரபரப்பாகப் பேசப்படும் வார்த்தையாக #WFH- (Work From Home) உள்ளது. COVID -19 பரவியதை அடுத்து, IT மற்றும் ITயால் செயல்படக்கூடிய நிறுவனங்கள் வீட்டிலிருந்து வேலை செய்வதை (Work from Home) எளிதில் பின்பற்றினர். இதை அரசு மற்றும் சர்வதேச அமைப்புகளும் ஊக்குவித்தாலும், வீட்டிலிருந்து வேலை செய்யும் வசதி அனைவர்க்கும் கிடையாது என்று விமர்சகர்கள் சுட்டிக்காட்டியுள்ளனர். AIMO- (All India Manufacturers Association) - சொல்வது என்னவென்றால், வீட்டிலிருந்து செய்யப்படும் முக்கிய வேலைகள் MSME (Micro, Small and Medium Enterprises) மற்றும் சேவைத் துறையில் 8% க்கும் குறைவாகவே பொருந்தும்[1].</p><p>‘வீட்டிலிருந்து வேலை செய்யமுடியுமா?, எப்படி செய்வது?’, ‘உங்களுக்கும் உங்கள் நிறுவனத்திற்கும் எப்படி சாத்தியமாகும்?’ என்பதைபற்றி&nbsp;அறிய இந்த Blog(வலைப்பதிவு) உதவும் என்று நம்புகிறோம்.</p><p><strong style=\"color: rgb(153, 153, 153);\"><u>நீங்கள் மேலும் படிக்கும் முன் :</u></strong><span style=\"color: rgb(153, 153, 153);\"> பெரும்பாலான MSME-களுக்கு, இந்தச்&nbsp;சோதனையான நேரத்தில் Survival-(தொழிலை நடத்துவது) மட்டுமே முக்கியமான விஷயமாக இருக்கும். அதற்கு Cashflow-பணப்புழக்கம் அவசியம். அடுத்த இரண்டு மாதங்களுக்கு உங்கள் Cashflow-பணப்புழக்கத்தைத் திட்டமிடுமாறு நாங்கள் பரிந்துரைக்கிறோம். திட்டமிடும்போது சம்பளம் மற்றும் ஊதியம் (படிக்க:</span> <a href=\"https://tamil.news18.com/news/business/government-to-pay-employer-and-employees-pf-contribution-for-3-months-ra-272181.html\" target=\"_blank\">Govt.’s EPF Contribution[2]</a>)<span style=\"color: rgb(153, 153, 153);\">, மாத தவணை (படிக்க:</span> <a href=\"https://www.hindutamil.in/news/business/546513-rbi-cuts-rate.html\" target=\"_blank\">EMI மீதான Moratorium[3]</a>)<span style=\"color: rgb(153, 153, 153);\">, சப்ளையர் கடன், வாடகை, காப்பீடு போன்றவற்றை மனதில் வைத்துக் கொள்ளவும்.</span></p><p>MSME-களில் முக்கியமான செயல்பாடுகளை வீட்டிலிருந்து செய்ய முடியாது என்பதை நான் ஏற்றுக்கொள்கிறேன்.&nbsp;இருப்பினும், சூழ்நிலையின் கட்டாயத்தால் சில MSME நிறுவனங்கள் இதைத் தழுவியுள்ளன, அவற்றில் சிலவற்றை நான் இங்கு&nbsp;விவரிக்க விரும்புகிறேன்.</p><p>உதாரணமாக, தேனியைச் சேர்ந்த ஒரு அரிசி உற்பத்தியாளர் தனது இரண்டாம் நிலை தலைவர்கள் மற்றும் அலுவலக ஊழியர்களுக்கு&nbsp;&nbsp;(Production Head, Accounts Head, HR, Executives and Data entry operators) வீட்டிலிருந்து வேலைசெய்யும் முறையை அமல்படுத்தியுலார் அமல்படுத்தியுள்ளார். இந்த நேரத்தில் அவர்களது பழைய&nbsp;ERPயிலிருந்து புதிதாக உருவாக்கப்பட்ட Cloud-அடிப்படையில் இயங்கும் ERPக்கு Data-வை இடம்பெயர்வும், testing-ங்கும் செய்கிறார்கள். நிறுவனத்தின் HR இந்த நெருக்கடியான சூழ்நிலையைச் சமாளித்து&nbsp;வருகிறார், மேலும் HR-Consultant உடன் ஒருங்கிணைந்து Role Clarity Document-ஐ உருவாக்குதல், KRAs (Key Result Areas), KPIs (Key Performance Indicators) மற்றும் - Performance Score Card-ஐ உருவாக்குதல் போன்ற சிறந்த HR நடைமுறைகளைச் செயல்படுத்தி வருகிறார்கள். அவர்கள் வரும் வாரங்களில் Process Documentation மற்றும் SOP(Standard Operating Procedure) -களை உருவாக்கும் முயற்சியில் இருக்கிறார்கள்.</p><p>இந்த நிறுவனத்தின் இயக்குனர் <a href=\"http://www.jnjacademy.com/\" target=\"_blank\">Journey in Joy</a> -Leadership Transformation Program-இன் பழைய உறுப்பினராவர். அடுத்த ஒன்று அல்லது இரண்டு மாதங்கள் கடினமாக இருந்தாலும் அவர்களின் குழு செய்யவிருக்கும் இப்பணிகள், அவர்களை முன்பைவிட&nbsp;மேலும் வலுவானவர்களாக மாற்ற உதவும் என்று கூறுகிறார்.</p><p>இதில் சுவாரஸ்யம் என்னவென்றால், இந்த எடுத்துக்காட்டில் பெரும்பாலான ஊழியர்களுக்கு வேலை செய்யச் சொந்த Laptop-கள் இருந்தது, மற்றவர்களின்&nbsp;வீடுகளில் Desktop-கள் அமைத்துக் கொடுக்கப்பட்டது.</p><p>மற்றொரு சுவாரஸ்யமான எடுத்துக்காட்டு, மதுரையில் உள்ள ஒரு கட்டிடக் கலைஞரின்(Architect) நிறுவனம், வழக்கமான drawing வேலைக்கும் கூடுதலாக Google forms-ஐ பயன்படுத்தி Online survey மூலம் அவர் வாடிக்கையாளர்களின் விருப்பங்களைப் புரிந்துகொள்ள ஒரு Research-ஐ தொடங்கிருக்கிறார்.</p><p>இவர்கள் சாதாரண குறு, சிறு மற்றும் நடுத்தரத் தொழில்முனைவோரே, அவர்களும் இந்தச் சூழலுக்குத் தள்ளப்படும் வரை ‘வீட்டிலிருந்து வேலை செய்ய முடியுமா?’ என்ற சந்தேகம் இருந்தது தான் நிதர்சனம்.</p><p>பூர்ணதாவில் நாங்களும் வீட்டிலிருந்தே எங்கள் வழக்கமான வேலைகளுக்கும் கூடுதலாக வெளி நபர்களுடன்&nbsp;இணைந்து புது முயற்சிகளையும் செய்துகொண்டு வருகிறோம் (அவர்களும் வீட்டிலிருந்து வேலை செய்கிறார்கள்).</p><ul><li>எங்கள் <a href=\"http://www.madeentrepreneur.org/\" target=\"_blank\">MADE</a>-partner-களுடன் இணைந்து MSME வணிக மதிப்பீட்டு செயல்முறையை&nbsp;உருவாக்குதல் (Business Assessment Tool)</li><li>Knowledge sharing செய்வதற்காக இரண்டு வெவ்வேறு Tech company-களுடன் இணைந்து இணையதளங்களை உருவாக்குதல்</li><li>வடிவமைப்பாளர்கள் (Designer) மூலம் Course Material மற்றும் புத்தகங்களை வடிவமைத்தல்</li><li>செயல்முறைகளை ஒழுங்குபடுத்துதல் மற்றும் SOP-களை உருவாக்குதல், எங்கள் பல்வேறு நடவடிக்கைகளுக்கானChecklist- களை தயாரித்தல்</li></ul><p>போன்ற வேலைகளைச் செய்து வருகிறோம்</p><p>பெரும்பாலான MSME-களுக்கு, தொலைதூரத்திலிருந்து வேலை செய்யச் சில IT infrastructure மேம்பாடு மற்றும் மறுசீரமைப்பு தேவைப்படும். தொழில்முனைவோர் தகவல்தொடர்பு சிக்கல்கள், தரவு பாதுகாப்பு சிக்கல்கள் மற்றும் செயல்திறன் வீழ்ச்சி போன்றவற்றால் கவலைப்படுகிறார்கள்.</p><p>MSME தலைவர்களும் அவர்களது குழுக்களும் வீட்டிலிருந்து செய்ய முயற்சிக்கலாம் என்று நாங்கள் நினைக்கும் சில வேலைகள் :</p><ol><li>நீங்கள் பல நாட்களாகப்&nbsp;போட வேண்டும் என்று நினைத்த Business Plan-ஐ இப்போது போடலாம்.</li><li>Marketing plan அல்லது ஒரு Sales plan போடலாம்.</li><li>இணையத்தில் Market research&nbsp;செய்யலாம்.</li><li>உங்கள் வணிகம் அல்லது தொழிலுக்குப்&nbsp;பொருந்தக்கூடிய பல்வேறு அரசு திட்டங்கள்&nbsp;மற்றும் மானியங்கள்பற்றிப் படித்து அறியலாம்.</li><li>உங்கள் வணிகத்திற்கு சம்பந்தப்பட்ட சட்டங்களையும், விதிகளையும் புரிந்து கொள்ளலாம்.</li><li>உலகெங்கிலும் இருந்து உங்கள் துறை சம்பந்தப்பட்ட சிறந்த நடைமுறைகளைக் (global best practices)கற்றுக்கொள்ளலாம்</li><li>Online Marketing கற்றுக் கொள்ளலாம் அல்லது உங்கள் வணிகத்திற்கான ஆன்லைன் presence -ஐ உருவாக்கலாம்.</li><li>உங்கள் நிறுவனத்தின் முக்கிய செயல்பாடுகளுக்கு SOP -Standard Operating Procedure -களை உருவாக்கலாம்.</li><li>HR செயல்முறைகள் மற்றும் கொள்கைகளை உருவாக்கலாம்</li><li>உங்கள்&nbsp;இணையதளத்தை உருவாக்கலாம் அல்லது புதுப்பிக்கலாம். (பெரும்பாலான Web Developers மற்றும் Content writers வீட்டிலிருந்து வேலை செய்கிறார்கள், இதைச் செய்ய இதுவே சிறந்த நேரம்).</li><li>உங்கள் Team-ற்கு வேலைகளைச் சிறப்பாக ஒதுக்கி நிர்வகிக்க, productivity app-களை செயல்படுத்த கற்றுக்கொள்ளலாம்.</li><li>உங்கள் Team- உடன் தொழில் தொடர்பான கட்டுரைகளைப்(articles)&nbsp;படித்து Discuss செய்யலாம்.</li></ol><p>இந்தப் பட்டியல் நீண்டதாகத் தோன்றினாலும், உங்கள் ஊழியர்களுடன் பேசியபிறகு அது மிகச் சிறியதாகத் தோன்றும் :)</p><p>உங்கள் Team-வுடன் call-செய்து, நீங்கள் வீட்டிலிருந்து செய்ய முடியும் என்று நினைக்கும் வேலைகளை&nbsp;&nbsp;எடுத்துக்காட்டாகக் கூறுங்கள், ஒன்று அல்லது இரண்டு நாட்கள் அவகாசம் கொடுத்து ஒரு Work list- வேலை பட்டியலைத்&nbsp;&nbsp;தயாரித்து&nbsp;&nbsp;கொண்டு வரச் சொல்லுங்கள்.&nbsp;அவர்கள் உங்களை ஆச்சரியப்படுத்தகூடும்.</p><p>வீட்டிலிருந்து வேலை செய்யும்பொழுது செய்ய வேண்டியவை மற்றும் செய்யக்கூடாதவற்றை பற்றி இணையத்தில் போதுமான கட்டுரைகள் உள்ளன, அவைபொதுவாக இவற்றைக் கூறுகின்றன :</p><ul><li>ஒரு schedule-ன்படி வேலை செய்தல்</li><li>தனியாக வேலைசெய்ய ஒரு நல்ல இடத்தை (முடிந்தவரை) - ஒரு நல்ல Chair, Desk மற்றும் நல்ல வெளிச்சத்துடன் இருக்குமாறு அமைத்துக்கொள்ளுதல்</li><li>தடையற்ற தகவல்தொடர்பை ஏற்படுத்தி அடிக்கடி வீடியோ மற்றும் தொலைபேசி அழைப்புகள்மூலம் குழுவிடம் Human Connection- னுடன் இருக்குமாறு பார்த்துக்கொள்ளுதல்</li><li>குடும்ப உறுப்பினர்களிடம் எதிர்பார்ப்புகளைத் தெளிவுபடுத்தல்</li></ul><p>வீட்டிலிருந்து வேலை செய்கிறீர்களோ இல்லையோ, உங்கள் குழுவுடன் SMS, அழைப்புகள் மற்றும் வீடியோ கான்பரன்சிங் மூலம் தொடர்ந்து தொடர்பில் இருப்பது அணியை ஒன்றாக வைத்திருக்க மிகவும் முக்கியமாகும்.</p><p>இந்த நிலைமை இயல்பானவுடன்,&nbsp;பெரும்பாலான MSME-களுக்கு Survival-கான&nbsp;ஓட்டமாக இருக்கக்கூடும். இருப்பினும், தொலை தூரத்திலிருந்துசெய்யக்கூடிய பணிகளை MSME-கள் கண்டறிந்து முயற்சிப்பது முக்கியம். இது நீங்கள் பணியாளர்களைப் பார்க்கும் விதத்தை மாற்றக்கூடும். இருப்பிடம் சில வேலைகளுக்கு ஒரு தடையாக இல்லாமல் இருக்ககூடும். இந்தப் பணிகளில் சில, வேறொரு நகரத்தில் அமர்ந்திருக்கும் ஒரு பகுதிநேர ஊழியரால் செய்யகூடியவையாக இருக்கலாம். தொலைதூரத்தில் வேலை செய்யக்கூடிய&nbsp;நிறுவனங்கள் பெரிய திறமைசாலிகளை ஈர்க்க முடியும், பயன்பாடு மற்றும்&nbsp;உபகரண (Equipment) செலவுகளைக் குறைக்க முடியும்.</p><p>ஆங்கிலத்தில் ‘when life gives you lemons make lemonade’ (lemon juice) என்பார்கள்.&nbsp;இந்தச் சூழ்நிலையைச் சாதகமாகப் பயன்படுத்தி, இதிலிருந்து&nbsp;முன்பைவிட வலுவாக நாம் வெளிவர வேண்டும்.</p><p># வீட்டிலிருந்து எழுதப்பட்ட பதிவு</p><p><strong>#வீட்டில் இருங்கள் #பாதுகாப்பாக இருங்கள்</strong></p><p>1 <a href=\"https://www.fortuneindia.com/venture/covid-19-aimo-seeks-relief-for-msmes/104321\" target=\"_blank\"><sup>https://www.fortuneindia.com/venture/covid-19-aimo-seeks-relief-for-msmes/104321</sup></a></p><p>2<a href=\"https://tamil.news18.com/news/business/government-to-pay-employer-and-employees-pf-contribution-for-3-months-ra-272181.html\" target=\"_blank\"><sup>https://tamil.news18.com/news/business/government-to-pay-employer-and-employees-pf-contribution-for-3-months-ra-272181.html</sup></a>&nbsp;&nbsp;&nbsp;</p><p>3 <a href=\"https://www.hindutamil.in/news/business/546513-rbi-cuts-rate.html\" target=\"_blank\"><sup>https://www.hindutamil.in/news/business/546513-rbi-cuts-rate.html</sup></a></p></div><div class=\"ql-clipboard\" contenteditable=\"true\" tabindex=\"-1\"></div><div class=\"ql-tooltip ql-hidden\"><a class=\"ql-preview\" target=\"_blank\" href=\"about:blank\"></a><input type=\"text\" data-formula=\"e=mc^2\" data-link=\"https://quilljs.com\" data-video=\"Embed URL\"><a class=\"ql-action\"></a><a class=\"ql-remove\"></a></div>','Active','Yes','can-msmes-workfromhome-tamil','can msmes work from home tamil குறு, சிறு மற்றும் நடுத்தரத் தொழில் நிறுவனங்கள் (MSME–கள்) வீட்டிலிருந்து வேலை செய்ய முடியுமா? (#WFH)','சிறு தொழில் நிறுவனங்கள் வீட்டிலிருந்து வேலை செய்ய முடியுமா? (#WFH)','blog',NULL,'Poornatha','2020-04-08 07:20:32','2020-04-15 06:13:22'),(19,'\'Surviving the Crisis\' (for small businesses)','Things small and medium businesses need to do to survive the crisis','19_1586523686.PNG','<div class=\"ql-editor\" data-gramm=\"false\" contenteditable=\"true\" data-placeholder=\"Compose an epic...\" spellcheck=\"false\"><p class=\"ql-align-justify\">For most organisations (including Not-for-Profit Organisations) and individuals alike, the first priority during a crisis is to SURVIVE. </p><p class=\"ql-align-justify\">From an individual perspective, it is important that an Entrepreneur should neither play god (not everything is under your control) nor play the victim of circumstances (self-sympathy). </p><p class=\"ql-align-justify\">Awareness of the situation and clear communication to both internal and external stakeholders are very crucial in this situation to control the panic.</p><p class=\"ql-align-justify\">Now let’s imagine a family in a car during a total lock down scenario. The distance that the car can travel is determined by the quantity of fuel in the tank, mileage (efficiency of the car) and the next available petrol bunk. </p><p class=\"ql-align-justify\">In this example the car represents your organisation, the family represents employees, fuel represents cash, mileage efficiency represents your expenses and the distance to the next petrol bunk is the time taken for the cash flow situation to normalize. The chance of survival is heavily dependent on understanding these factors before making decisions. For the safety of the car and its passengers the driver of the car (Business Owner) cannot afford to panic.</p><p class=\"ql-align-justify\">While what we have to say in this blog may not be entirely new to most readers, we hope that it provides you with a framework to think clearly and make appropriate decisions amongst all the noise and panic.</p><p><strong><u>Awareness:</u></strong></p><p class=\"ql-align-justify\">Financial and people dimension of decisions operate in tandem to each other and are equally important. Therefore, it is important to balance both. </p><p class=\"ql-align-justify\">Though the leader strives to safeguard the interest of all stakeholders, the bitter truth about the survival stage is that some inevitable sacrifices and hard decisions have to be made. </p><p class=\"ql-align-justify\">Survival of an organisation during crisis like these depend largely on cash flows. Therefore, finance generally tends to act as a runway to make people related decisions. </p><p class=\"ql-align-justify\">In the current scenario we strongly recommend that you plan your cash flow for the next two months at least. The steps to make a plan can be broadly classified as review of expenses and cash positions.</p><p class=\"ql-align-justify\"><strong>Review of Expenses- </strong></p><p class=\"ql-align-justify\">After listing all expenses for the month, examine each expense and categorize them as critical and non-critical (or essential and non-essential) for the present situation. Identify parties with whom negotiation is possible. Depending on the financial position the organisation may choose to pay all expenses, defer payments to some (in part or full), ask people to take voluntary cuts or in extreme cases lay off. </p><p class=\"ql-align-justify\">Let us now look at some expense items in detail:</p><p class=\"ql-align-justify\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Salaries and Wages</p><p class=\"ql-align-justify\">It is most likely to be the biggest expense and the most sensitive of all. Smaller organisations may take advantage of the Governments contribution to EPFO for certain class of employers<a href=\"about:blank\" target=\"_blank\">[1]</a>. In dealing with salaries, lessons may be drawn from the bigger firms and MNCs and start-ups in handling this. </p><p class=\"ql-align-justify\">For example- </p><p class=\"ql-align-justify\">a.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;top executives either forgo or take deep pay cuts, </p><p class=\"ql-align-justify\">b.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;some of them have put in a hiring freeze,</p><p class=\"ql-align-justify\">c.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;year-end bonuses and appraisal have been cancelled, </p><p class=\"ql-align-justify\">d.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;deferred part payment of salary beyond a basic amount till cash flow revives,</p><p class=\"ql-align-justify\">e.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;some start-ups have even asked employees to voluntarily offer to take pay cuts based on their <a href=\"https://www.inc.com/justin-bariso/instead-of-laying-off-20-of-his-company-this-ceo-made-an-unusual-decision-its-a-lesson-in-emotional-intelligence.html\" target=\"_blank\">affordability</a><a href=\"about:blank\" target=\"_blank\">[2]</a>. </p><p class=\"ql-align-justify\">This shows that the decisions are not binary (i.e. not that you either pay fully or don’t pay at all), it could be fine balance somewhere in between too (i.e. Partial cut or partial deferral).</p><p class=\"ql-align-justify\">Employers have to keep in mind that livelihoods depend on their decision in these difficult times and their treatment of employees during the time of crisis says a lot about them. Laying out the facts, options available to the organisation and involving the employees in the decision-making process in one way of handling it. </p><p class=\"ql-align-justify\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Rent- </p><p class=\"ql-align-justify\">This might again be a bigger bill depending on the type of business. The above listed options of full payment, deferred payment/ part payment may be used here too. You may also consider negotiating with landlords to work out a concessional rent for warehouses, shops etc. not used during the period. <a href=\"https://www.businesstoday.in/latest/trends/coronavirus-tata-starbucks-asks-outlet-landlords-for-3-month-rent-waiver/story/400351.html\" target=\"_blank\" style=\"color: blue;\"><sup><u>[3]</u></sup></a> <sup>&amp; </sup><a href=\"https://economictimes.indiatimes.com/industry/services/retail/lockdown-effect-restaurants-cinemas-retailers-at-malls-seek-zero-rentals-till-may/articleshow/74956239.cms?from=mdr\" target=\"_blank\" style=\"color: blue;\"><sup><u>[4]</u></sup></a></p><p class=\"ql-align-justify\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Repayment of Loans-</p><p class=\"ql-align-justify\">The organisations in need may make the best use of the Moratorium on loans brought in by the Reserve Bank. However, one should keep in mind that the moratorium is merely a deferment, and not waiver on EMI payments. Interest will still accrue on the outstanding loans. It is important to note that credit cards carry a much higher interest rate and might result in a heavier <a href=\"https://www.moneycontrol.com/news/business/personal-finance/rbi-moratorium-avoid-postponing-credit-card-dues-and-escape-exorbitant-interest-costs-5103691.html\" target=\"_blank\">burden</a><a href=\"about:blank\" target=\"_blank\">[5]</a>. Therefore, it is better for organisations with no cash flow problem to pay as per schedule.&nbsp;</p><p class=\"ql-align-justify\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Supplier payments-</p><p class=\"ql-align-justify\">This is most likely the easiest to postpone depending on the business. However, it might still be prudent to make part payments so as to not strain relations with good suppliers and over burden them. </p><p class=\"ql-align-justify\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Electricity- </p><p class=\"ql-align-justify\">This could be a considerably big expense especially for manufacturers. No relief has been announced so far and consumers have been asked to pay based on previous months bill. Therefore, this needs to be planned accordingly.</p><p class=\"ql-align-justify\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Insurance-</p><p class=\"ql-align-justify\">You may consider renewal or postponement of insurance payments based on value of stock and risk attached to it. Essential businesses that remain open during this time may consider taking up new insurance policies to protect their employees and/or themselves (Read: <a href=\"https://www.livemint.com/money/personal-finance/shopkeepers-can-buy-covid-19-cover-from-bharatpe-11585561333611.html\" target=\"_blank\">BharatPe-ICICI Lombard</a><a href=\"about:blank\" target=\"_blank\">[6]</a>, <a href=\"https://www.livemint.com/money/personal-finance/reliance-general-insurance-launches-covid-19-protection-insurance-cover-11586333920929.html\" target=\"_blank\">Reliance</a><a href=\"about:blank\" target=\"_blank\">[7]</a>). The Government has also relaxed dates to pay premiums on certain insurance <a href=\"https://www.livemint.com/news/india/covid-19-premium-pay-for-health-third-party-auto-insurance-policyholders-eased-11585808454229.html\" target=\"_blank\">policies</a><a href=\"about:blank\" target=\"_blank\">[8]</a>.</p><p class=\"ql-align-justify\">It is needless to say that “Cash is King”, so ruthless cutting down of expenditure might be required. It requires revisiting of new capital expenditure (including replacement), marketing expenses and even small expenses like Magazine or other subscriptions etc. Some large companies have even cut down on refreshment expenses (tea, coffee and snacks etc…).</p><p class=\"ql-align-justify\"><strong>Cash Position-</strong></p><p class=\"ql-align-justify\">The next step is to determine the cash position of the organisation by considering:</p><p class=\"ql-align-justify\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Bank balance, </p><p class=\"ql-align-justify\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Other easily liquid able assets (if any)</p><p class=\"ql-align-justify\">Example- Short-term deposits, Fixed deposits, Debt based funds, Gold, Bonds etc… (Shares and Mutual funds may not exactly be liquidable in the current market scenario, however, they too may be considered for extreme scenarios) </p><p class=\"ql-align-justify\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Availability of Cash Credit or Overdraft Facility with bank </p><p class=\"ql-align-justify\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Receivable management- </p><p class=\"ql-align-justify\">While most customer might have already suspended payments, it might be crucial and worthwhile to follow up with customers to receive as many payments as possible. Maintaining a cordial relationship with customers will be important for this. You could also offer cash discounts or negotiate a part payment to get payments at the earliest. </p><p class=\"ql-align-justify\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Inventory –</p><p class=\"ql-align-justify\">Explore the possibility of bulk liquidation of excess inventory for immediate cash, though the possibility in the current scenario may be remote.</p><p class=\"ql-align-justify\">As a small-scale manufacturer rightly mentioned, for some businesses the problem is not in bearing the expenses in the short term (which is also drawn from short term credit) but it is about collectability of receivables that were outstanding right before the pandemic broke.</p><p class=\"ql-align-justify\">During this phase when the organisation battles for survival, the leaders focus has to be on the <em>“now and here”</em> (short term) keeping the larger long-term picture in mind. We do understand that this is easier said than done.</p><p><strong><u>Communication </u></strong></p><p class=\"ql-align-justify\">To be able to communicate clearly the leader should first be clear in his/her mind. Proactive and open communication is extremely important to maintain trust amongst all stakeholders, most importantly your employees.</p><p class=\"ql-align-justify\"><img src=\"data:image/png;base64,\"></p><p class=\"ql-align-justify\">Once the decisions are made for each of the expenses, it is important to communicate the decision to the concerned party with reason and clarity. Employees and stakeholders should not be left second guessing till the payday arrives. Communicating difficulties in payments in advance gives them the most valuable time to plan and make alternate arrangement to take care of their own affairs.</p><p>Once the organisation overcomes the Survival stage, it will then be time to Stabilize and then to Sustain. </p><p class=\"ql-align-center\">Survive =&gt; Stabilize =&gt; Sustain</p><p># This too shall pass for if winter comes, can spring be far behind?</p><p><br></p><p>  <a href=\"about:blank\" target=\"_blank\">[1]</a> <a href=\"https://www.businesstoday.in/current/economy-politics/relief-for-employers-govt-to-bear-epfo-contribution/story/399304.html\" target=\"_blank\">https://www.businesstoday.in/current/economy-politics/relief-for-employers-govt-to-bear-epfo-contribution/story/399304.html</a> </p><p class=\"ql-align-justify\"><a href=\"about:blank\" target=\"_blank\">[2]</a><a href=\"https://www.inc.com/justin-bariso/instead-of-laying-off-20-of-his-company-this-ceo-made-an-unusual-decision-its-a-lesson-in-emotional-intelligence.html\" target=\"_blank\">https://www.inc.com/justin-bariso/instead-of-laying-off-20-of-his-company-this-ceo-made-an-unusual-decision-its-a-lesson-in-emotional-intelligence.html</a></p><p><a href=\"about:blank\" target=\"_blank\">[3]</a> <a href=\"https://www.businesstoday.in/latest/trends/coronavirus-tata-starbucks-asks-outlet-landlords-for-3-month-rent-waiver/story/400351.html\" target=\"_blank\">https://www.businesstoday.in/latest/trends/coronavirus-tata-starbucks-asks-outlet-landlords-for-3-month-rent-waiver/story/400351.html</a> </p><p><a href=\"about:blank\" target=\"_blank\">[4]</a> <a href=\"https://economictimes.indiatimes.com/industry/services/retail/lockdown-effect-restaurants-cinemas-retailers-at-malls-seek-zero-rentals-till-may/articleshow/74956239.cms?from=mdr\" target=\"_blank\">https://economictimes.indiatimes.com/industry/services/retail/lockdown-effect-restaurants-cinemas-retailers-at-malls-seek-zero-rentals-till-may/articleshow/74956239.cms?from=mdr</a></p><p><a href=\"about:blank\" target=\"_blank\">[5]</a> <a href=\"https://www.moneycontrol.com/news/business/personal-finance/rbi-moratorium-avoid-postponing-credit-card-dues-and-escape-exorbitant-interest-costs-5103691.html\" target=\"_blank\">https://www.moneycontrol.com/news/business/personal-finance/rbi-moratorium-avoid-postponing-credit-card-dues-and-escape-exorbitant-interest-costs-5103691.html</a></p><p><a href=\"about:blank\" target=\"_blank\">[6]</a> <a href=\"https://www.livemint.com/money/personal-finance/shopkeepers-can-buy-covid-19-cover-from-bharatpe-11585561333611.html\" target=\"_blank\">https://www.livemint.com/money/personal-finance/shopkeepers-can-buy-covid-19-cover-from-bharatpe-11585561333611.html</a></p><p><a href=\"about:blank\" target=\"_blank\">[7]</a> <a href=\"https://www.livemint.com/money/personal-finance/reliance-general-insurance-launches-covid-19-protection-insurance-cover-11586333920929.html\" target=\"_blank\">https://www.livemint.com/money/personal-finance/reliance-general-insurance-launches-covid-19-protection-insurance-cover-11586333920929.html</a></p><p><a href=\"about:blank\" target=\"_blank\">[8]</a> <a href=\"https://www.livemint.com/news/india/covid-19-premium-pay-for-health-third-party-auto-insurance-policyholders-eased-11585808454229.html\" target=\"_blank\">https://www.livemint.com/news/india/covid-19-premium-pay-for-health-third-party-auto-insurance-policyholders-eased-11585808454229.html</a></p></div><div class=\"ql-clipboard\" contenteditable=\"true\" tabindex=\"-1\"></div><div class=\"ql-tooltip ql-hidden\"><a class=\"ql-preview\" target=\"_blank\" href=\"about:blank\"></a><input type=\"text\" data-formula=\"e=mc^2\" data-link=\"https://quilljs.com\" data-video=\"Embed URL\"><a class=\"ql-action\"></a><a class=\"ql-remove\"></a></div>','Active','Yes','surviving-the-crisis-sme','Lockdown MSME crisis covid19 corona small business cash flow management people firing lay off HR survive sustain bounce back','\'Surviving the Crisis\' (for small businesses)','blog',NULL,'Poornatha','2020-04-10 12:49:08','2020-05-02 14:28:37'),(20,'நெருக்கடியில் ஓர் எதிர்நீச்சல்','நெருக்கடியை சமாளிக்க சிறு நிறுவனங்கள் என்ன செய்ய வேண்டும்','20_1586783608.png','<div class=\"ql-editor\" data-gramm=\"false\" contenteditable=\"true\" data-placeholder=\"Compose an epic...\"><p>எந்த ஒரு நெருக்கடியை சந்திக்கும் பொழுதும், அதிலிருந்து எப்படி மீண்டு எழுவது (survive செய்வது) என்பதே நம் முதல் கட்ட சிந்தனையாக இருக்கும்.</p><p>இந்நிலையில் ஒரு தொழில்முனைவோர் தன் மனதளவில் கடவுள்போல இருக்க முயற்சிக்க கூடாது - don’t play god (எல்லாம் உங்கள் கட்டுப்பாட்டில் இல்லை) அதே சமயத்தில் தன்னை தாமே பலியாடு என்று எண்ண கூடாது - don’t play victim (தன்னிரக்கம் கூடாது).</p><p>இந்தச் சூழ்நிலையில் பீதியைக்<strong>/</strong>பதற்றத்தை கட்டுப்படுத்த நிலைமைகுறித்த விழிப்புணர்வும்(Awareness of the Situation), நிறுவனம் சார்ந்தவர்களுடனும் (உள் மற்றும் வெளிப்புற) தெளிவான தகவல்தொடர்புகளும் (communication)&nbsp;மிக முக்கியம்.</p><p>இன்றைய நிலைமையை ஒரு சிறிய எடுத்துக்காட்டைக் கொண்டு புரிந்துகொள்ள முயல்வோம். இந்த lockdown சமயத்தில் ஒரு குடும்பம் ஒரு car-ல் பயணம் செய்து கொண்டு இருக்கிறது என்று வைத்துக்கொள்வோம். அந்த car எவ்வளவு தூரம் செல்ல முடியும் என்பது அந்தக் carல் உள்ள petrolன் அளவு, mileage efficiency மற்றும் அடுத்த petrol bunk-ன் தூரத்தைச் சார்ந்தே உள்ளது.</p><p>இப்பொழுது அந்த car தான் உங்களுடைய business. பயணிகள் உங்களுடைய employees. petrol அளவு தான் உங்கள் business-ல் உள்ள பண இருப்பு (cash balance), mileage efficiency உங்கள் business-ன் செலவுகளையும் மற்றும் அடுத்த petrol bunkன் தூரம் என்பது cash flow இயல்பு நிலைக்கு வரத் தேவைப்படும் கால அவகாசத்தையும் குறிக்கும். எனவே car (business) மற்றும் பயணிகளின் (employees) பாதுகாப்பை கருதி, driver (business owner) பதட்டமடையாமல் நிதானத்துடன் செயல்பட வேண்டும். அவ்வாறு பதட்டமின்றி, மேற்படி சொன்ன அனைத்து factorsஐயும் நினைவில் கொண்டு முடிவுகளை எடுப்பதில்தான் இந்த நெருக்கடியிலிருந்து நாம் மீண்டு வரும் வாய்ப்புகள் முற்றிலும் சார்ந்துள்ளது.&nbsp;&nbsp;&nbsp;</p><p>இந்த blog-ன் மூலமாக நாங்கள் கூறும் விஷயங்கள் முற்றிலும் புதிதாக இல்லை எனினும், உங்களின் தெளிந்த சிந்தனைக்கும் செயல்பாட்டிற்கும் ஊன்றுகோலாக இருக்கக்கூடும் என நம்புகிறோம்.</p><p><strong>Awareness of the situation</strong></p><p>நிதி நிலைமையும் HR முடிவுகளும் ஒன்றை ஒன்று சார்ந்தவை ஆகும். ஆயினும், நெருக்கடியான சூழல் ஏற்படுகையில் ஒரு தொழிலதிபர் எவ்வளவுதான் stakeholdersன் நலனைப் பாதுகாக்க பாடுபட்டாலும் சில தவிர்க்க முடியாத தியாகங்களைச் செய்தாக நேரிடும்.</p><p>தற்போதுள்ள நிலையில், ஒரு தொழிலதிபர் குறைந்தபட்சம் அடுத்த இரண்டு மாதத்திற்க்கான cash flow பற்றித் திட்டமிட பரிந்துரை செய்கிறோம். ஒரு cash flow plan-ஐ உருவாக்க அடிப்படையான செயல்கள் என்னவென்றால் – செலவுகளை (expenses) தெளிவாக ஆராய்வது மற்றும் பண இருப்பு, வரவு (cash position) பற்றிய விவரங்களை அறிவது.</p><p><u>செலவுகளை&nbsp;(expenses) ஆராய்வது</u></p><ul><li>உங்களின் மாதாந்திர செலவுகளைப் பட்டியலிடவும்.</li><li>அவற்றில் தற்போதைய நிலைமையில் எந்தச் செலவு அவசியம், எது அனாவசியம் என்று பிரிக்கவும்.</li><li>எவருடன் பேசினால், payment செய்ய சற்று அவகாசம் கிடைக்கும் அல்லது payment தொகையில் தள்ளுபடி கிடைக்கும் என அடையாளம் காணவும்.</li><li>இவ்வாறு செய்தப் பிறகு, பண நிலையை (cash position) கருத்தில் கொண்டு, payments-ஐ தக்க முறையில் கையாளவும்.</li></ul><p>சில முக்கிய செலவுகளை விவரமாகக் காண்போம்:</p><ul><li>சம்பளம் (salaries and wages)</li></ul><p>இச்செலவு மாதாந்திர செலவுகளில் ஒரு முக்கியமான பெரிய பங்காக விளங்குகிறது. EPFOக்கு அரசாங்கத்தின் பங்களிப்பை குறிப்பிட்ட சிறிய நிறுவனங்கள் பயன்படுத்திக் கொள்ளலாம் <a href=\"https://www.businesstoday.in/current/economy-politics/relief-for-employers-govt-to-bear-epfo-contribution/story/399304.html\" target=\"_blank\">[1]</a>. சம்பளத்தை பொறுத்த வரையில், பெரிய MNC-யில் இருந்து start-up வரை அனைத்து ரகமான நிறுவனங்களிடமிருந்தும் கையாளும் முறைகளை கற்றுக்கொள்ளலாம்.</p><p>உதாரணத்திற்கு,</p><p>&nbsp;எந்த ஒரு நெருக்கடியை சந்திக்கும் பொழுதும், அதிலிருந்து எப்படி மீண்டு எழுவது (survive செய்வது) என்பதே நம் முதல் கட்ட சிந்தனையாக இருக்கும்.</p><p>இந்நிலையில் ஒரு தொழில்முனைவோர் தன் மனதளவில் கடவுள்போல இருக்க முயற்சிக்க கூடாது - don’t play god (எல்லாம் உங்கள் கட்டுப்பாட்டில் இல்லை) அதே சமயத்தில் தன்னை தாமே பலியாடு என்று எண்ண கூடாது - don’t play victim (தன்னிரக்கம் கூடாது).</p><p>இந்தச் சூழ்நிலையில் பீதியைக்<strong>/</strong>பதற்றத்தை கட்டுப்படுத்த நிலைமைகுறித்த விழிப்புணர்வும்(Awareness of the Situation), நிறுவனம் சார்ந்தவர்களுடனும் (உள் மற்றும் வெளிப்புற) தெளிவான தகவல்தொடர்புகளும் (communication)&nbsp;மிக முக்கியம்.</p><p>இன்றைய நிலைமையை ஒரு சிறிய எடுத்துக்காட்டைக் கொண்டு புரிந்துகொள்ள முயல்வோம். இந்த lockdown சமயத்தில் ஒரு குடும்பம் ஒரு car-ல் பயணம் செய்து கொண்டு இருக்கிறது என்று வைத்துக்கொள்வோம். அந்த car எவ்வளவு தூரம் செல்ல முடியும் என்பது அந்தக் carல் உள்ள petrolன் அளவு, mileage efficiency மற்றும் அடுத்த petrol bunk-ன் தூரத்தைச் சார்ந்தே உள்ளது.</p><p>இப்பொழுது அந்த car தான் உங்களுடைய business. பயணிகள் உங்களுடைய employees. petrol அளவு தான் உங்கள் business-ல் உள்ள பண இருப்பு (cash balance), mileage efficiency உங்கள் business-ன் செலவுகளையும் மற்றும் அடுத்த petrol bunkன் தூரம் என்பது cash flow இயல்பு நிலைக்கு வரத் தேவைப்படும் கால அவகாசத்தையும் குறிக்கும். எனவே car (business) மற்றும் பயணிகளின் (employees) பாதுகாப்பை கருதி, driver (business owner) பதட்டமடையாமல் நிதானத்துடன் செயல்பட வேண்டும். அவ்வாறு பதட்டமின்றி, மேற்படி சொன்ன அனைத்து factorsஐயும் நினைவில் கொண்டு முடிவுகளை எடுப்பதில்தான் இந்த நெருக்கடியிலிருந்து நாம் மீண்டு வரும் வாய்ப்புகள் முற்றிலும் சார்ந்துள்ளது.&nbsp;&nbsp;&nbsp;</p><p>இந்த blog-ன் மூலமாக நாங்கள் கூறும் விஷயங்கள் முற்றிலும் புதிதாக இல்லை எனினும், உங்களின் தெளிந்த சிந்தனைக்கும் செயல்பாட்டிற்கும் ஊன்றுகோலாக இருக்கக்கூடும் என நம்புகிறோம்.</p><p><strong>Awareness of the situation</strong></p><p>நிதி நிலைமையும் HR முடிவுகளும் ஒன்றை ஒன்று சார்ந்தவை ஆகும். ஆயினும், நெருக்கடியான சூழல் ஏற்படுகையில் ஒரு தொழிலதிபர் எவ்வளவுதான் stakeholdersன் நலனைப் பாதுகாக்க பாடுபட்டாலும் சில தவிர்க்க முடியாத தியாகங்களைச் செய்தாக நேரிடும்.</p><p>தற்போதுள்ள நிலையில், ஒரு தொழிலதிபர் குறைந்தபட்சம் அடுத்த இரண்டு மாதத்திற்க்கான cash flow பற்றித் திட்டமிட பரிந்துரை செய்கிறோம். ஒரு cash flow plan-ஐ உருவாக்க அடிப்படையான செயல்கள் என்னவென்றால் – செலவுகளை (expenses) தெளிவாக ஆராய்வது மற்றும் பண இருப்பு, வரவு (cash position) பற்றிய விவரங்களை அறிவது.</p><p><u>செலவுகளை&nbsp;(expenses) ஆராய்வது</u></p><ul><li>உங்களின் மாதாந்திர செலவுகளைப் பட்டியலிடவும்.</li><li>அவற்றில் தற்போதைய நிலைமையில் எந்தச் செலவு அவசியம், எது அனாவசியம் என்று பிரிக்கவும்.</li><li>எவருடன் பேசினால், payment செய்ய சற்று அவகாசம் கிடைக்கும் அல்லது payment தொகையில் தள்ளுபடி கிடைக்கும் என அடையாளம் காணவும்.</li><li>இவ்வாறு செய்தப் பிறகு, பண நிலையை (cash position) கருத்தில் கொண்டு, payments-ஐ தக்க முறையில் கையாளவும்.</li></ul><p>சில முக்கிய செலவுகளை விவரமாகக் காண்போம்:</p><ul><li>சம்பளம் (salaries and wages)</li></ul><p>இச்செலவு மாதாந்திர செலவுகளில் ஒரு முக்கியமான பெரிய பங்காக விளங்குகிறது. EPFOக்கு அரசாங்கத்தின் பங்களிப்பை குறிப்பிட்ட சிறிய நிறுவனங்கள் பயன்படுத்திக் கொள்ளலாம் <a href=\"https://www.businesstoday.in/current/economy-politics/relief-for-employers-govt-to-bear-epfo-contribution/story/399304.html\" target=\"_blank\">[1]</a>. சம்பளத்தை பொறுத்த வரையில், பெரிய MNC-யில் இருந்து start-up வரை அனைத்து ரகமான நிறுவனங்களிடமிருந்தும் கையாளும் முறைகளை கற்றுக்கொள்ளலாம்.</p><p>உதாரணத்திற்கு,</p><ol><li>உயர் நிர்வாகிகள் சம்பளத்தை கைவிடுவர் அல்லது குறைத்து பெறுவர்</li><li>மேற்படி வேலைக்கு ஆட்கள் எடுப்பதை stop செய்வர்</li><li>Year-end bonus மற்றும் yearly increments ரத்து செய்வர்</li><li>சம்பளத்தில் ஒரு பங்கைத் தற்போது கொடுத்து மீதியை தாமதமாகக் கொடுக்க முயல்வர்</li><li>சில start-ups அவர்களின் employees இடம் அவரவர் வசதிக்கேற்ப சம்பள குறைவை மேற்கொள்ளுமாறு கேட்டுக்கொள்வர் <a href=\"https://www.inc.com/justin-bariso/instead-of-laying-off-20-of-his-company-this-ceo-made-an-unusual-decision-its-a-lesson-in-emotional-intelligence.html\" target=\"_blank\">[2]</a>.</li></ol><p>மேலும், நிறுவனத்தின் தலைவரின் இந்த முடிவின் அடிப்படையில் தான் தொழிலாளிகளின் வாழ்வியல் அடங்கி இருக்கிறது என்றும், இம்மாதிரி சூழ்நிலையில் அவர்கள் தொழிலாளிகளை எவ்வாறு நடத்துகிறார் என்பது அவர்களைப் பற்றின எண்ணத்தை வெளிப்படுத்தும் என்றும் நினைவில் கொள்ள வேண்டும்.</p><p>இந்தச் சூழ்நிலையை இப்படியும் கையாளலாம்- உங்களிடம் உள்ள அனைத்து facts மற்றும் optionகளை முன்வைத்து, சம்பளத்தை பற்றின முடிவுகளை எடுக்கும் பணியில் தொழிலாளர்களை ஈடுபட செய்யலாம்.</p><ul><li>வாடகை (rent)</li></ul><p>சம்பளத்தை போல வாடகையும் ஒரு பெரிய செலவாக இருக்ககூடும். எனவே, சம்பளத்தை கையாள மேற்கண்ட options (full payment, deferred(ஒத்திவைப்பு)&nbsp;payment or part payment) அனைத்தும் வாடகைக்கும் பொருந்தும். இந்த காலகட்டத்தில் உபயோக படுத்தாத கடைகள் மற்றும் godown-க்கு செலுத்தும் வாடகையில் சலுகை ஏதேனும் தருமாறு கேட்டுப்பார்க்கலாம்<a href=\"https://www.businesstoday.in/latest/trends/coronavirus-tata-starbucks-asks-outlet-landlords-for-3-month-rent-waiver/story/400351.html\" target=\"_blank\">[3]</a>&amp;<a href=\"https://economictimes.indiatimes.com/industry/services/retail/lockdown-effect-restaurants-cinemas-retailers-at-malls-seek-zero-rentals-till-may/articleshow/74956239.cms?from=mdr\" target=\"_blank\">[4]</a>.</p><ul><li>Repayment of loans</li></ul><p>இச்சூழலில் தொழில் முனைவோருக்கு உதவ Reserve Bank, loan EMI மீதான Moratorium கொண்டு வந்திருக்கிறது. இந்த சலுகையைப் பயன்படுத்திக்கொண்டாலும், இது loan பணம் செலுத்துவதை ஒத்தி வைப்பது மட்டுமே தவிர முற்றிலும் ரத்து செய்யவில்லை என்பதை கருத்தில் கொள்ள வேண்டும். இதில் முக்கியமான விஷயம் என்னவென்றால், outstanding loanக்கான வட்டி தொகை பெருகும். Credit cardன் interest rate சற்று அதிகமாகவே இருக்கக்கூடும், எனவே பணப்புழக்கத்தில் எதுவும் சிரமம் இல்லை என்றால் Credit card billஐ நேரத்திற்கு செலுத்துவது நல்லது<a href=\"https://www.moneycontrol.com/news/business/personal-finance/rbi-moratorium-avoid-postponing-credit-card-dues-and-escape-exorbitant-interest-costs-5103691.html\" target=\"_blank\">[5]</a>.</p><ul><li>Supplier payments</li></ul><p>இது ஒரு அளவிற்கு எளிதாக ஒத்திவைக்கக்கூடிய செலவாக இருக்க கூடும். எனினும், ஒரு பகுதி தொகையைச் செலுத்துவதன்&nbsp;மூலம், அவர்களது பாரமும் சற்று குறையும் மற்றும் business relationship நன்றாக இருப்பதற்கு சிறந்த செயலாக இருக்கும். எந்த dealers or suppliers உடன் பேசினால், payment செய்ய சற்று அவகாசம் கிடைக்கும் அல்லது payment தொகையில் தள்ளுபடி கிடைக்கும் என்றும் பார்க்கலாம்.</p><ul><li>Electricity</li></ul><p>மின்சாரக் கட்டணம், முக்கியமாக உற்பத்தியாளர்களுக்கு, ஒரு பெரிய தொகையாக இருக்கலாம். இதுவரையில் அரசு தரபில் எந்த வகையான சலுகையும் அறிவிக்கப்படவில்லை. முந்தைய மாத bill-ஐ அடிப்படையாக கொண்டு பணம் செலுத்துமாறு அறிவிக்க பட்டிருக்கிறது. எனவே இதற்கு ஏற்ப பணத்திட்டத்தை வகுக்க வேண்டும்.&nbsp;</p><ul><li>Insurance</li></ul><p>Stockன் மதிப்பு மற்றும் அதனுடைய risk-ஐ அடிப்படையாகக் கொண்டு insurance-ஐ renew செய்யலாம் அல்லது ஒத்திவைக்கலாம். இந்நேரத்தில் இயங்கிக்கொண்டு இருக்கும் அத்தியாவசிய வணிகங்கள் பாதுகாப்பிற்காக புதிய insurance policiesஐ எடுத்து கொள்ளலாம் (Read:&nbsp;<a href=\"https://www.livemint.com/money/personal-finance/shopkeepers-can-buy-covid-19-cover-from-bharatpe-11585561333611.html\" target=\"_blank\">BharatPe - ICICI Lombard</a><a href=\"about:blank\" target=\"_blank\">[6]</a>,&nbsp;<a href=\"https://www.livemint.com/money/personal-finance/reliance-general-insurance-launches-covid-19-protection-insurance-cover-11586333920929.html\" target=\"_blank\">Reliance</a><a href=\"about:blank\" target=\"_blank\">[7]</a>). சில insurance policies-ன் premium செலுத்தும் தேதியை அரசாங்கம் நிதானப்படுத்தியுள்ளது (Read: <a href=\"https://www.livemint.com/news/india/covid-19-premium-pay-for-health-third-party-auto-insurance-policyholders-eased-11585808454229.html\" target=\"_blank\">Premium due dates</a> <a href=\"about:blank\" target=\"_blank\">[8]</a>).&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p>பணப்புழக்கம் (cash flow) மிகவும் முக்கியமான பகுதியை வகிக்கும் இந்த சமயத்தில், அனைத்து&nbsp;தேவையற்ற செலவுகளையும் (example - marketing expenses, புது மூலதன (capital) செலவுகள், expansion of business, etc.,)&nbsp;தீவிரமாக குறைத்துக்கொள்வது சிறந்த செய்கையாகும். சில பெரிய நிறுவனங்கள், புத்துணர்ச்சி செலவுகளையும் (tea, coffee மற்றும் தின்பண்டங்கள்) குறைத்துள்ளனர்.</p><p><u>பண</u> <u>நிலை</u> <u>(cash position)</u></p><p>அடுத்ததாக உங்களது பண இருப்பின் நிலையை அறிய வேண்டும். அதற்க்கு கீழ்வருபவற்றை பற்றிய விவரங்கள் அவசியமாகும்:</p><ul><li>bank balance (வங்கி இருப்பு)</li><li>எளிதில் பணமாக மாற்றக்கூடிய assets-ன் இருப்பு (example - bankல் வைத்திருக்கும் deposits, gold, bonds etc.,)</li><li>Bank-ல் உள்ள overdraft அல்லது cash credit வசதிகள்</li><li>நமக்கு பணம் கொடுக்க வேண்டிய parties, இந்நிலையில் அவர்கள் ஏற்கனவே paymentsஐ நிறுத்தி இருக்க வாய்ப்புகள் உண்டு. இருப்பினும், அவர்களிடம் தொடர்புகொண்டு கூடுமானவரை பணம் வசூலிக்க முயல வேண்டும். அதே சமயத்தில், அவர்களிடம் நல்லுறவை தொடர வேண்டும். அவர்கள் செலுத்த வேண்டிய தொகையில் தள்ளுபடி அல்லது பாதி தொகை செலுத்த அனுமதித்தல் ஆகியவற்றை மேற்கொள்வது உங்கள் பணயிருப்பை அதிகரிக்க உதவும்.</li><li>Inventory - தற்போதய சூழலில் stock-ஐ clear செய்து உடனடி பணம் பெறுவது (liquidation of stock) கடினம் எனினும் அந்த முயற்சியை மேற்கொண்டு பார்க்கலாம்.</li></ul><p>Small scale உற்பத்தியாளர் ஒருவர் கூறுகையில், \"short - term&nbsp;செலவுகளை தாங்கிக் கொள்வது கூட பிரச்சனையாக இருக்காது ஆனால்&nbsp;இதுவரை வரவேண்டிய&nbsp;பணத்தை வசூலிப்பதில்தான் சிரமம் இருக்கக்கூடும்\" என்றார்.</p><p>இந்த நெருக்கடியான கட்டத்தில் போராடிக்கொண்டிருக்கும் நிலையில், தொழிலதிபரின் கவனம் தற்காலத்தை (short-term) நோக்கியவண்ணம் இருக்க வேண்டும் அதே சமயத்தில், நீண்ட காலம் (long-term) தாக்கத்தை (impact) நினைவில் கொள்வதும் அவசியம் தான். இதை சொல்வது எளிது ஆனால் செய்வது கடினம் என்பது நிதர்சனமான உண்மையாகும்.&nbsp;&nbsp;</p><p>பண நிலை மற்றும் செலவு பற்றிய திட்டங்களை உருவாக்குவதோடு மட்டும் ஒரு தொழிலதிபர் -ன் வேலை முடியவில்லை. தற்போதைய நிலை மற்றும் முடிவுகளை business-ஐ சார்ந்த அனைவரிடமும் தெளிவாக communicate செய்வது ஒரு முக்கியமான காரியமாகும்.</p><p><strong>Communication</strong></p><p>தகவலை மற்றவருடன் பகிர்வதற்கு முன், அந்த நிறுவனத்தின் தலைவர் முதலில் சிந்தனை தெளிவு இருக்க வேண்டும். நிறுவனத்தின் மீதுள்ள நம்பிக்கையை தக்கவைக்க, அந்நிறுவனத்தை சார்ந்த அனைவருக்கும் (employees உட்பட) தக்க விஷயங்களை தெளிவாக communicate செய்வது அவசியமாகும்.&nbsp;</p><p><img src=\"data:image/png;base64,\"></p><p>செலவுகளை குறித்த முடிவுகளை எடுத்தபின்னர், அதனை சம்மந்தப்பட்ட நபருக்கு (Stakeholders மற்றும் employees) முன்கூட்டியே தெரியப்படுத்த வேண்டும். அவர்களுக்கு payment செய்வதில் ஏதேனும் மாற்றங்கள் இருக்கும் பட்சத்தில், முன்னதாகவே தெரியப்படுத்தினால் அவர்களின் செலவுகளை&nbsp;கவனித்துக் கொள்ளதக்க மாற்று ஏற்படுகளை மேற்கொள்வர்.</p><p>ஒரு நிறுவனம் நெருக்கடியைச் சமாளித்து (survive) மீண்டு எழுந்ததும், அதன் existenceஐ உறுதிப்படுத்தவும் (stabilize), மேலும் நிலைநாட்டவும் (sustain) தக்க நேரம் வரும்.&nbsp;</p><p>சோதனைகளை கடந்து வந்து சாதனைகள் ஆக்குவது தொழில் முனைவோருக்கு புதிதல்ல. இதையும் புன்சிரிப்புடன் மேற்கொண்டு நம் மைல்கல்லை நிலைநாட்டும் நாள் தொலைவில் இல்லை என்பதை நினைவில் கொள்வோம்.</p><p>இதுவும் கடந்து போகும்!&nbsp;</p><p><a href=\"about:blank\" target=\"_blank\">[1]</a>&nbsp;<a href=\"https://www.businesstoday.in/current/economy-politics/relief-for-employers-govt-to-bear-epfo-contribution/story/399304.html\" target=\"_blank\">https://www.businesstoday.in/current/economy-politics/relief-for-employers-govt-to-bear-epfo-contribution/story/399304.html</a></p><p><a href=\"about:blank\" target=\"_blank\">[2]</a><a href=\"https://www.inc.com/justin-bariso/instead-of-laying-off-20-of-his-company-this-ceo-made-an-unusual-decision-its-a-lesson-in-emotional-intelligence.html\" target=\"_blank\">https://www.inc.com/justin-bariso/instead-of-laying-off-20-of-his-company-this-ceo-made-an-unusual-decision-its-a-lesson-in-emotional-intelligence.html</a></p><p><a href=\"about:blank\" target=\"_blank\">[3]</a>&nbsp;<a href=\"https://www.businesstoday.in/latest/trends/coronavirus-tata-starbucks-asks-outlet-landlords-for-3-month-rent-waiver/story/400351.html\" target=\"_blank\">https://www.businesstoday.in/latest/trends/coronavirus-tata-starbucks-asks-outlet-landlords-for-3-month-rent-waiver/story/400351.html</a></p><p><a href=\"about:blank\" target=\"_blank\">[4]</a>&nbsp;<a href=\"https://economictimes.indiatimes.com/industry/services/retail/lockdown-effect-restaurants-cinemas-retailers-at-malls-seek-zero-rentals-till-may/articleshow/74956239.cms?from=mdr\" target=\"_blank\">https://economictimes.indiatimes.com/industry/services/retail/lockdown-effect-restaurants-cinemas-retailers-at-malls-seek-zero-rentals-till-may/articleshow/74956239.cms?from=mdr</a></p><p><a href=\"about:blank\" target=\"_blank\">[5]</a>&nbsp;<a href=\"https://www.moneycontrol.com/news/business/personal-finance/rbi-moratorium-avoid-postponing-credit-card-dues-and-escape-exorbitant-interest-costs-5103691.html\" target=\"_blank\">https://www.moneycontrol.com/news/business/personal-finance/rbi-moratorium-avoid-postponing-credit-card-dues-and-escape-exorbitant-interest-costs-5103691.html</a></p><p><a href=\"about:blank\" target=\"_blank\">[6]</a>&nbsp;<a href=\"https://www.livemint.com/money/personal-finance/shopkeepers-can-buy-covid-19-cover-from-bharatpe-11585561333611.html\" target=\"_blank\">https://www.livemint.com/money/personal-finance/shopkeepers-can-buy-covid-19-cover-from-bharatpe-11585561333611.html</a></p><p><a href=\"about:blank\" target=\"_blank\">[7]</a>&nbsp;<a href=\"https://www.livemint.com/money/personal-finance/reliance-general-insurance-launches-covid-19-protection-insurance-cover-11586333920929.html\" target=\"_blank\">https://www.livemint.com/money/personal-finance/reliance-general-insurance-launches-covid-19-protection-insurance-cover-11586333920929.html</a></p><p><a href=\"about:blank\" target=\"_blank\">[8]</a>&nbsp;<a href=\"https://www.livemint.com/news/india/covid-19-premium-pay-for-health-third-party-auto-insurance-policyholders-eased-11585808454229.html\" target=\"_blank\">https://www.livemint.com/news/india/covid-19-premium-pay-for-health-third-party-auto-insurance-policyholders-eased-11585808454229.html</a></p></div><div class=\"ql-clipboard\" contenteditable=\"true\" tabindex=\"-1\"></div><div class=\"ql-tooltip ql-hidden\"><a class=\"ql-preview\" target=\"_blank\" href=\"about:blank\"></a><input type=\"text\" data-formula=\"e=mc^2\" data-link=\"https://quilljs.com\" data-video=\"Embed URL\"><a class=\"ql-action\"></a><a class=\"ql-remove\"></a></div>','Active','Yes','surviving-the-crisis-sme-tamil','Things small and medium businesses need to do to survive the crisis','நெருக்கடியில் ஓர் எதிர்நீச்சல்','blog',NULL,'Poornatha','2020-04-13 13:13:28','2020-05-02 14:57:42'),(21,'Poornatha vs COVID-19','Though it has been a tough time for people around the world, the crisis seems to have only made Poornatha stronger','21_1590775667.png','<div class=\"ql-editor\" data-gramm=\"false\" contenteditable=\"true\" data-placeholder=\"Compose an epic...\"><p class=\"ql-align-justify\"><strong>March 5, 2020,</strong> Poornatha received its first bank transfer from a client for its Journey in Joy Leadership Transformation which was due to start on 16<sup>th </sup>April. The young team at Poornatha was filled with hope and giddy optimism, for we were closer to fulfilling the revenue target promised to our Investor who has been fully funding us for the past couple of years. It was also supposed to be one of the first major steps towards the much longer journey we had in mind to transform the MSME sector across the globe. Little did we know that we had a hard-left turn waiting, not just for us but the global population. It has been a truly VUCA world since then. (VUCA- volatility, uncertainty, complexity and ambiguity)</p><p class=\"ql-align-justify\">In the weeks that followed, we monitored the global, national and local situation continuously and took actions ranging from cancellation of meeting with potential applicants (which usually happened at large hotel conference halls) and vendors, cancellation of trips for multiple Intern teams travelling from Ross School of Business for multiple projects (which were later converted to Work from home assignments) in addition to the standard social distancing and sanitization protocols implemented in our office. We also started adopting to Work from Home a good one week before the official lockdown announcement from the Government. </p><p class=\"ql-align-justify\">Uncertainty surrounded the start of the program and we started sending out communications regarding the same to our 100+ applicants on 23<sup>rd</sup> March 2020. As weeks went by it became increasingly clear that staring the program in the next few months was not a reality. Though we had stopped collecting fees for JnJ 2.0 in March 2020, we decided to proactively refund the money received in April 2020. </p><p class=\"ql-align-justify\">In the meantime, we tried to reach out to the Entrepreneurs community through the small ways we could, including </p><p class=\"ql-align-justify\">a)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Crisis time Leadership Session by our Chief Mentor for both the Alumni and the second cohort applicants of JnJ through video conferencing and Youtube, followed by a Q&amp;A session</p><p class=\"ql-align-justify\">b)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Published two articles in English and Tamil to help MSMEs embrace the new normal, tilted – </p><p class=\"ql-align-justify\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;i.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Surviving the Crisis for Small Business and</p><p class=\"ql-align-justify\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;ii.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Can MSMEs work from Home</p><p class=\"ql-align-justify\">During these difficult times, the team at Poornatha has tried to make the best use of the lockdown time to carry out development activities like</p><p class=\"ql-align-justify\">a)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;E-learning options are being explored and considered, to take JnJ online</p><p class=\"ql-align-justify\">b)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Fine-tuning of training materials and content</p><p class=\"ql-align-justify\">c)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Business Assessment tool built during the lockdown waiting beta testing</p><p class=\"ql-align-justify\">d)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Multiple Internship projects have been established with 17+ interns working from 7 different states in India and US on projects ranging from E-learning to SME Landscape study. The interns are from some of the best institutions like Ross School of Business, IIM-Bangalore, IIM-Indore, BIMTECH (Noida), NIT-DoMS (Trichy) and TSM Madurai.</p><p class=\"ql-align-justify\">e)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;To make Poornatha a tech-enabled company, new avenues have been explored and a SaaS product is being developed in association with Mr. Sarav who has teamed with Team Poornatha to float a Joint Venture for the same. </p><p class=\"ql-align-justify\">There has been no alteration in the salaries paid to employees during this period. However, the Co-Creators of the organization have voluntarily chosen to defer 50% of their compensation during the time of the crisis to be able to comfortably fund the development activities. The team also negotiated a 50% reduction in rent during the lockdown period for the new property taken on rent just before the lockdown. </p><p class=\"ql-align-justify\">The most important forced adoption is the Work from Home model which has enabled us to tap into a national talent pool and rethink staffing. We realized it is a new normal and we have broken physical boundaries and suddenly have a work a force that’s working from <strong>7 states</strong> across the country. Now we are checking the national news more regularly to understand about the locust attack in Jaipur, the highest daily corona cases in Pune, the cyclone in West Bengal and check if Poornatha’s interns in these states are affected. It indeed is a new normal for the organization.</p><p>Though it has been a tough time for people around the world, the crisis seems to have only made Poornatha stronger and more capable to take up any opportunities and challenges that may come in its way.</p></div><div class=\"ql-clipboard\" contenteditable=\"true\" tabindex=\"-1\"></div><div class=\"ql-tooltip ql-hidden\"><a class=\"ql-preview\" target=\"_blank\" href=\"about:blank\"></a><input type=\"text\" data-formula=\"e=mc^2\" data-link=\"https://quilljs.com\" data-video=\"Embed URL\"><a class=\"ql-action\"></a><a class=\"ql-remove\"></a></div>','Active','Yes','Poornatha-vs-COIVD-19','Poornatha Crisis leadership survive startup funding Corona COVID-19','Poornatha vs COVID-19','blog',NULL,'Poornatha','2020-05-29 18:07:47','2020-06-06 21:43:32');
INSERT INTO `blogs` VALUES (23,'Poornatha Industry-Academia partnerships','Creating Industry-Academia partnerships to bring the best of opportunities for the student community and the MSME ecosystem simultaneously.','23_1591360088.png','<div class=\"ql-editor\" data-gramm=\"false\" contenteditable=\"true\" data-placeholder=\"Compose an epic...\" spellcheck=\"false\"><p class=\"ql-align-justify\"><span style=\"color: rgb(38, 38, 38);\">We at Poornatha are creating Industry-Academia partnerships to bring the best of opportunities for the student community and the MSME ecosystem simultaneously. </span></p><p class=\"ql-align-justify\"><span style=\"color: rgb(38, 38, 38);\">Poornatha has a long-standing relationship with the </span><strong style=\"color: rgb(38, 38, 38);\">Ross School of Business, University of Michigan</strong><span style=\"color: rgb(38, 38, 38);\">. MAP </span><strong style=\"color: rgb(38, 38, 38);\">(Multidisciplinary Action Projects)</strong><span style=\"color: rgb(38, 38, 38);\"> teams have been working with Poornatha or its affiliates since 2009 on a variety of Projects. Regular </span><strong style=\"color: rgb(38, 38, 38);\">internships</strong><span style=\"color: rgb(38, 38, 38);\"> are also provided to Ross MBA Candidates which last for about </span><strong style=\"color: rgb(38, 38, 38);\">10 weeks,</strong><span style=\"color: rgb(38, 38, 38);\"> through </span><a href=\"https://madeentrepreneur.org/\" target=\"_blank\">MADE</a><span style=\"color: rgb(38, 38, 38);\"> (Michigan Academy for Developing Entrepreneurs) or </span><a href=\"https://wdi.umich.edu/\" target=\"_blank\">WDI</a><span style=\"color: rgb(38, 38, 38);\"> (William Davison Institute). </span></p><p class=\"ql-align-justify\"><span style=\"color: rgb(38, 38, 38);\">In addition to these programs, Poornatha also works closely with student run teams like Living Business Leadership Experience </span><a href=\"https://michiganross.umich.edu/courses/lble-living-business-leadership-experience-11103\" target=\"_blank\">(LBLE)</a><span style=\"color: rgb(38, 38, 38);\"> and International Investment Fund </span><a href=\"https://www.uminternationalfund.com/\" target=\"_blank\">(IIF)</a><span style=\"color: rgb(38, 38, 38);\">. Multiple engagements engulfing areas such as due diligence, consulting are being carried out with focus on MSMEs in India. About 60 Students from Ross School of Business, University of Michigan have visited our offices in India over the last decade.</span></p><p class=\"ql-align-justify\"><span style=\"color: rgb(38, 38, 38);\">Closer to home, we are also working closely with multiple institutions to provide similar opportunities to our student community. First of our efforts was a Survey on Mass Entrepreneurship in Tamil Nadu </span><a href=\"https://drive.google.com/file/d/1wbFSPY2OvTfJK2DhDHP4NE3ztyaXLady/view\" target=\"_blank\">(Report)</a><span style=\"color: rgb(38, 38, 38);\"> executed with the help of student community. The project involved </span><strong style=\"color: rgb(38, 38, 38);\">247 students from 9 colleges</strong><span style=\"color: rgb(38, 38, 38);\"> across Tamil Nadu.&nbsp;</span></p><p class=\"ql-align-justify\"><span style=\"color: rgb(38, 38, 38);\">In the recent months we have also established&nbsp;cross-country teams&nbsp;for smaller projects that would enable knowledge, skills and cultural sharing amongst the students from both countries (India and USA).</span></p><p class=\"ql-align-justify\"><img src=\"data:image/jpeg;base64,\"></p><p class=\"ql-align-justify\"><span style=\"color: rgb(38, 38, 38);\">During the Covid-19 lockdown, Poornatha has provided internship to </span><strong style=\"color: rgb(38, 38, 38);\"><em>17 Students, a</em></strong><span style=\"color: rgb(38, 38, 38);\">ll of whom are working remotely, from 5 different B-Schools including- IIM-Bangalore, </span><strong style=\"color: rgb(38, 38, 38);\">IIM-Indore, BIMTECH- Birla Institute of Management Technology (Greater Noida), DoMS -NIT (Trichy) and TSM- Thiagarajar School of Management (Madurai).</strong></p><p class=\"ql-align-justify\"><span style=\"color: rgb(38, 38, 38);\">List of Institutions in Poornatha’s Network-</span></p><p class=\"ql-align-justify\">1.&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"color: rgb(38, 38, 38);\">Ross School of Business, University of Michigan </span></p><p class=\"ql-align-justify\">2.&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"color: rgb(38, 38, 38);\">IIM-Bangalore</span></p><p class=\"ql-align-justify\">3.&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"color: rgb(38, 38, 38);\">IIM- Indore</span></p><p class=\"ql-align-justify\">4.&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"color: rgb(38, 38, 38);\">NIT- DoMS- Trichy </span></p><p class=\"ql-align-justify\">5.&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"color: rgb(38, 38, 38);\">BIMTECH- Birla Institute of Management Technology - Noida</span></p><p class=\"ql-align-justify\">6.&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"color: rgb(38, 38, 38);\">Thiagarajar School of Management (TSM)- Madurai</span></p><p class=\"ql-align-justify\">7.&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"color: rgb(38, 38, 38);\">Thiagarajar College of Arts and Science- Madurai</span></p><p class=\"ql-align-justify\">8.&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"color: rgb(38, 38, 38);\">Vels Institute of Science, Technology &amp; Advanced Studies (VISTAS) - Chennai</span></p><p class=\"ql-align-justify\">9.&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"color: rgb(38, 38, 38);\">Madura College – Madurai</span></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><span style=\"color: rgb(38, 38, 38);\">In the medium term Poornatha wishes to expand this network and create value for both the student community and MSMEs through structured partnership programs that connect them.</span></p><p><br></p><p><img src=\"data:image/png;base64,\"></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong><u>Illustrative List of Remote Projects -2020</u></strong></p><p class=\"ql-align-center\"><strong><u>﻿</u></strong></p><p class=\"ql-align-justify\"><strong>1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Study of Poornatha’s Pricing Strategy</strong> by Emma Kwenu Smith (MBA Candidate -Ross School of Business) titled <em>“How consulting companies focused on SMEs in emerging economies can refine their pricing models: Case Study on Poornatha Partnering Entrepreneurs LLP”</em></p><p class=\"ql-align-justify\"><strong>2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Exploration of Virtual Classroom options for Journey in Joy- Online</strong></p><p class=\"ql-align-justify\"><strong>3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;E-Learning - Research on Modes and Educational Pedagogy</strong></p><p class=\"ql-align-justify\">	The project includes study of </p><p class=\"ql-align-justify\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;E-learning platforms (including Remote Learning) </p><p class=\"ql-align-justify\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Analysis of all the possible Modes of content delivery available, bring out the pros and cons of each model and effectiveness of learning </p><p class=\"ql-align-justify\">Factors to be considered includes – Technology, format of content, faculty interaction, assignments, support system, handling queries etc... </p><p class=\"ql-align-justify\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Studying global best practices in E-Learning and the learning pedagogy/andragogy that supports it</p><p class=\"ql-align-justify\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Identification of appropriate mode of content delivery for different customer segments </p><p class=\"ql-align-justify\"><strong>4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;E-Learning - Monetization of E-Learning Content</strong></p><p class=\"ql-align-justify\">	The project includes meticulously understanding and researching on the </p><p class=\"ql-align-justify\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;The mediums/ platforms available for content sharing (including but not limited to YouTube, Edx.org, Coursera (and other MOOC), Masterclass.com, Udemy, Upgrad LinkedIn Learning, etc…) </p><p class=\"ql-align-justify\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Monetization through apps in Playstore (Android) and App Store (iOS) </p><p class=\"ql-align-justify\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Method of promotion and monetization of content on social media like Facebook, Instagram, LinkedIn, etc… </p><p class=\"ql-align-justify\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Possibility to share content across platforms </p><p class=\"ql-align-justify\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Appropriate audience/customer segments for each medium/platform </p><p class=\"ql-align-justify\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Organic vs Paid customer(user) acquisition strategies </p><p class=\"ql-align-justify\"><strong>5.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Development and deployment of <em>Industry Knowledge Framework </em></strong></p><p class=\"ql-align-justify\">Interns will be required to develop and deploy a framework and capture information for organizations in the SME space and/or others in select sectors. </p><p class=\"ql-align-justify\">The project has two parts: </p><p class=\"ql-align-justify\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Creating/Developing a framework and identification of key parameters for business functions </p><p class=\"ql-align-justify\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Research and capturing of information in the created framework relevant to SMEs </p><p class=\"ql-align-justify\"><strong>6.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;SME Landscape Study</strong></p><p class=\"ql-align-justify\">SMEs across the globe contribute a significant portion to any country’s GDP. How’s the SME context like across the globe? How is it different between developed and developing economies.</p><p class=\"ql-align-justify\">The intern(s) will have to carry out a full-fledged research on SMEs in developed economies such as Germany (Middlestead), Japan, South Korea, New Zealand etc. SMEs in the Middle East and in developing economies such as Indonesia etc.</p><p class=\"ql-align-justify\">The other integral and interesting part to this project will be to study and understand generational perspectives of SME entrepreneurs in these countries and broadly classify few entrepreneurial traits/attributes of these SME entrepreneurs. </p><p class=\"ql-align-justify\">	The project includes meticulously understanding and researching on the </p><p class=\"ql-align-justify\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Financial capabilities of entrepreneur promoters </p><p class=\"ql-align-justify\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Their decision-making capabilities resulting in growth </p><p class=\"ql-align-justify\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Succession planning and generational perspectives including family structure </p><p class=\"ql-align-justify\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Access to finance </p><p class=\"ql-align-justify\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Policy/ Support from the governments </p><p class=\"ql-align-justify\"><strong>7.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong><strong style=\"color: rgb(34, 34, 34);\">Development of a strategic framework and plan for an EDO (MADE)</strong><span style=\"color: rgb(34, 34, 34);\"> – To develop a strategic framework for Poornatha to utilize when designing their product offerings and strategy for the next 24 to 36 months. The intern will </span>assess the local climate in which Poornatha operates. It includes anticipating market needs and product offerings, best pricing strategies for the target market, competitive landscape and industry trends and overarching strategy for profitability.&nbsp;</p></div><div class=\"ql-clipboard\" contenteditable=\"true\" tabindex=\"-1\"></div><div class=\"ql-tooltip ql-hidden\"><a class=\"ql-preview\" target=\"_blank\" href=\"about:blank\"></a><input type=\"text\" data-formula=\"e=mc^2\" data-link=\"https://quilljs.com\" data-video=\"Embed URL\"><a class=\"ql-action\"></a><a class=\"ql-remove\"></a></div>','Active','Yes','industry-academia','Poornatha Industry-Academia partnerships','Poornatha Industry-Academia partnerships','blog',NULL,'Poornatha','2020-05-30 14:49:06','2020-06-05 20:34:41');
